import Navbar from "./Navbar";
import Forecast from "./Forecast";

function App() {
  return (
    <div className="w-screen h-screen bg-obsidian text-white grid grid-cols-body grid-rows-body justify-items-center items-center">
      <Navbar />
      <input type="text" placeholder="Search for cities" className="border-0 bg-light-obsidian h-50 w-600 rounded-2xl p-4 outline-none" />
      <Forecast />
    </div>
  );
}

export default App;
